package java8.misc;public class ClonableExample {    public static void main(String[] args) throws CloneNotSupportedException {        D d1 = new D();        D d2 = (D) d1.clone();        System.out.println(d1 == d2);        System.out.println(System.identityHashCode(d1) + " : " + d1);        System.out.println(System.identityHashCode(d2) + " : " + d2);    }}class D implements Cloneable {    public D() {    }    @Override    protected Object clone() throws CloneNotSupportedException {        return super.clone();    }}